import '../container/content.css'
import DsCourseContent from './DsCourseContent';
const Content = () => {
        const handleSelectChange = (event) => {
          const selectedOption = event.target.value;
          // Handle the selected option as needed
          console.log('Selected option:', selectedOption);
        };
  return (
    <div className='content-part'>
         <div>
               <h3>Course Content</h3>
               
         </div>
         <div>
         <h3>Assignment and Quiz</h3>
               <select onChange={handleSelectChange}>
                 <option value='option1'>Assignment</option>
                 <option value='option2'>Quiz</option>
               </select>
         </div>
         <div>Discusson Forum</div>
         <div>
         <h3>Certificate</h3>
               <select onChange={handleSelectChange}>
                 <option value='option1'>Certificate Genarate</option>
                 <option value='option2'>Certificate Download</option>
               </select>
         </div>
    </div>
  )
}

export default Content
